INSERT INTO `fym_user_detail_1` VALUES (492166, 'a:11:{s:7:\"ky_juzi\";a:9:{i:0;s:140:\"此外，OPPO游戏手柄C1独角兽高达定制版、OPPO无线降噪耳机、闪充移动电源成为用户最喜爱的配件产品TOP3。\";i:1;s:441:\"除了几位男神之外，春晚经过第一轮带观众彩排之后，终于有望出现一位我们熟悉的女神，那就是赵薇。在这次的彩排中，有一首名为《六尺巷》的歌曲据传会由赵薇演唱，不过赵薇并未现身这次彩排，而是由替身演员代替走位。女神赵薇的衣品就像是坐过山车大起大落、时好时坏，如果这次能够登上春晚舞台，女神你可要长点心。\";i:2;s:81:\"呆拉这个维密天使被评为世界上最性感的人甚至掰弯了女明星\";i:3;s:142:\"此外，在本次峰会上浪潮云海InCloudOpenStack团队与百度智能云、无锡地铁信息管理部门共同入围超级用户评眩\";i:4;s:165:\"白色的开襟衫搭配一条飘逸的墨绿色半身裙，总让人感觉非常清新又带些古典气息，手拎一个编织篮子包非常有度假的气息。\";i:5;s:144:\"长款水貂皮外套，配以手工贴花波纹嵌花，采用繁复的技法将不同的色块嵌入水貂皮，形成持续的波纹图案。\";i:6;s:177:\"除了宽松的印花夹克个性十足，蔡依林的鞋子更是十分抢镜，这双褶皱长靴被网友们戏称为“水桶鞋”，这样的时尚真心让人看不懂。\";i:7;s:201:\"不过伊莉娜一直以来都对自己的身材管理非常严格，当初拍《体育画报》一举成名的她，也是凭靠着美艳的长相气质以及姣好的身材收获了超高的人气。\";i:8;s:267:\"大品牌要有大品牌担当，创维作为蜚声中外的家电品牌，作为中国家电领军企业，深知自主制造、自主创造对国家和民族的意义。因此，创维勇敢承担创新研发、产业升级责任，并不断获得突破性成就。\";}s:7:\"ky_btjz\";a:6:{i:0;N;i:1;N;i:2;N;i:3;N;i:4;N;i:5;N;}s:5:\"ky_bt\";a:33:{i:0;s:17:\"就人好好好22\";i:1;s:17:\"就人好好好22\";i:2;s:17:\"就人好好好22\";i:3;s:17:\"个人好好好11\";i:4;s:17:\"个人好好好11\";i:5;s:17:\"就人好好好22\";i:6;s:17:\"就人好好好22\";i:7;s:17:\"个人好好好11\";i:8;s:17:\"就人好好好22\";i:9;s:17:\"就人好好好22\";i:10;s:17:\"就人好好好22\";i:11;s:17:\"就人好好好22\";i:12;s:17:\"个人好好好11\";i:13;s:17:\"个人好好好11\";i:14;s:17:\"就人好好好22\";i:15;s:17:\"个人好好好11\";i:16;s:17:\"就人好好好22\";i:17;s:17:\"个人好好好11\";i:18;s:17:\"就人好好好22\";i:19;s:17:\"就人好好好22\";i:20;s:17:\"就人好好好22\";i:21;s:17:\"个人好好好11\";i:22;s:17:\"个人好好好11\";i:23;s:17:\"个人好好好11\";i:24;s:17:\"就人好好好22\";i:25;s:17:\"就人好好好22\";i:26;s:17:\"就人好好好22\";i:27;s:17:\"个人好好好11\";i:28;s:17:\"就人好好好22\";i:29;s:17:\"就人好好好22\";i:30;s:17:\"就人好好好22\";i:31;s:17:\"就人好好好22\";i:32;s:17:\"个人好好好11\";}s:8:\"cur_kytp\";a:1:{i:0;s:58:\"https://www.timg.site/allimg/20180711/1531278098441549.png\";}s:5:\"ky_xt\";a:15:{i:0;s:59:\"https://www.timg.site/allimg/120513/1_120513104658_1-lp.jpg\";i:1;s:59:\"https://www.timg.site/allimg/111014/1_111014083506_1-lp.png\";i:2;s:59:\"https://www.timg.site/allimg/111021/1_111021084732_1-lp.jpg\";i:3;s:55:\"https://www.timg.site/allimg/120528/1-12052