INSERT INTO `fym_user_detail_1` VALUES (492167, 'a:11:{s:7:\"ky_juzi\";a:9:{i:0;s:42:\"长颈鹿变白天鹅你只差一件Choker\";i:1;s:238:\"此次专家评审团，由权威科学家，小P老师、Kevin老师等美妆界KOL，网红达人团3大领域团队组成，分别从科技、使用测评、产品时尚感、市场潜力等不同维度对产品进行全方位评定。\";i:2;s:362:\"不过，线sPro这款新机作为新旗舰确实良心!就一个UFS30闪存芯片就真香极了!同时还搭载最新7nm的骁龙855Plus、mEngine30触感引擎、SupermTouch极速屏下指纹识别、4800万像素全索尼光学防抖AI三摄，而且正式上市后会搭载全新的Flyme8系统，配备全功能nfc，这些体验加起来居然只在2K档!\";i:3;s:580:\"此外，即便剧中有影帝、影后级人物参演，Angelababy也曾经对自己的表现说：“拼命了，但依旧有人担心她的演技会拖垮电影“。而梁朝伟则以“挖土豆”来形容她的演技，称：”她让我很惊喜，就好像你去田里挖一个土豆，你挖挖挖，结果挖了一串出来，然后你继续挖挖挖，挖了一个西瓜，我觉得她还有很多可能性，在拍片的现场也很有活力。”可见对Angelababy赞誉有加，不过网友仍不领情，笑称：”西瓜不用挖吧“;”谁要挖土豆啊!“\";i:4;s:442:\"除了冬宝、S冬之外，wuli徐冬冬偶尔还会客串出演“老师冬”，在她4月26日发布的一条微博中，徐冬冬便化身老师冬，图片中，她戴着黑框眼镜，白色T恤外搭黑色连衣裙，一股文艺老师范扑面而来，冬冬还配文道：“今天是老师冬…要给大家上课了…想听讲课请举手……”，网友们调侃回复道：“老师冬融合S冬，请问还有什么冬”。\";i:5;s:252:\"白衬衫和牛仔裙叠穿，瞬间把两件最普通单品搭配出不一样的时髦感;而对于难驾驭的oversize的白色毛衣，也能随意一拉穿出慵懒性感风;就连机场look也不走寻常路，单扣背带短裤也是酷得不要!\";i:6;s:428:\"蔡思贝，1991年2月6日出生于香港，中国香港女演员。2013年参加香港小姐竞选获得亚军后签约香港无线电视，从而进入演艺圈。同年，蔡思贝出演首部电视剧《八卦神探》。2014年，蔡思贝出演时装商战剧《名门暗战》;同年7月，蔡思贝主演青春偶像剧《冲线年，蔡思贝主演由张家辉执导的惊悚灵异恐怖电影《陀地驱魔人》。(\";i:7;s:387:\"此外，“十一”假期也是亲子游的绝佳时机，不少家庭选择趁着假期和小孩一同去探索世界，亲子游客占比达到了38%。与此同时，“乡村旅游”在近几年亦成为游客的新选择。数据显示，今年上半年，乡村旅游人数已达151亿人次，同比增长102%，乡村旅游总收入已经超过8600亿元，同比增长117%。\";i:8;s:49:\"艾玛·斯通获第89届奥斯卡最佳女主角\";}s:7:\"ky_btjz\";a:6:{i:0;N;i:1;N;i:2;N;i:3;N;i:4;N;i:5;N;}s:5:\"ky_bt\";a:33:{i:0;s:18:\"﻿个人好好好\";i:1;s:18:\"﻿个人好好好\";i:2;s:18:\"﻿个人好好好\";i:3;s:18:\"﻿个人好好好\";i:4;s:15:\"就人好好好\";i:5;s:15:\"就人好好好\";i:6;s:15:\"就人好好好\";i:7;s:18:\"﻿个人好好好\";i:8;s:15:\"就人好好好\";i:9;s:18:\"﻿个人好好好\";i:10;s:15:\"就人好好好\";i:11;s:15:\"就人好好好\";i:12;s:15:\"就人好好好\";i:13;s:15:\"就人好好好\";i:14;s:15:\"就人好好好\";i:15;s:18:\"﻿个人好好好\";i:16;s:18:\"﻿个人好好好\";i:17;s:15:\"就人好好好\";i:18;s:18:\"﻿个人好好好\";i:19;s:18:\"﻿个人好好好\";i:20;s:18:\"﻿个人好好好\";i:21;s:18:\"﻿个人好好好\";i:22;s:15:\"就人好好好\";i:23;s:15:\"就人好好好\";i:24;s:18:\"﻿个人好好好\";i:25;s:18:\"﻿个人好好好\";i:26;s:15:\"就人好好好\";i:27;s:18:\"﻿个人好好好\";i:28;s:18:\"﻿个人好好好\";i:29;s:18:\"﻿个人好好好\";i:30;s:15:\"就人好好好\";i:31;s:18:\"﻿个人好好好\";i:32;s:15:\"就人好好好\";}s:8:\"cur_