INSERT INTO `fym_user_detail_1` VALUES (492168, 'a:11:{s:7:\"ky_juzi\";a:9:{i:0;s:69:\"陈赫发合影约女同学吃饭合影的美颜程度遭网友质疑\";i:1;s:83:\"被吉尼斯认证的女歌手新专辑横扫各大排行榜61岁依然风情万种\";i:2;s:48:\"霸道总裁吴影演员金禹伯写真生活照\";i:3;s:297:\"不难发现，西蒙娜似乎永远身着半裙或是穿着套装，也似乎永远头盘丝巾。即使在二战结束之后，巴黎妇女已经开始好好捯饬头发，她却将这个造型保存了下来。丝巾与不同的印花裙装也永远成为了这位伟大女性的代表风格。\";i:4;s:144:\"穿上白色轻纱连衣裙的她仿佛是从天而降的仙女，显瘦修身的裙子，充满了优雅的味道，与金发搭配完美了。\";i:5;s:54:\"◆具有定义的RTO和PRO的跨集群灾备恢复卷\";i:6;s:211:\"白色的T恤搭配一身白色西装既干练又不失清新感，下搭浅蓝色高腰牛仔裤既休闲又不失个性，白色包包尖头高跟鞋呼应整体的色调，给人的感觉非常舒服大方。\";i:7;s:462:\"此次改造的济南百丽宫影城（恒隆广场店）、大连中影华臣影城（西安路店）以及新建的横店影城（四平商业大厦店），均配备了HOLOSOUND沉浸式音频处理器DCAPOBIA，HOLOSOUND数模转换器DACOBIA，HOLOSOUND32路数字环绕功放SMAOBIA等沉浸式音频放映端设备，能完美还原三维声场空间的独立声音，营造出饱满、细致而有深度的音效，创造出身临其境的观影体验。\";i:8;s:83:\"被嘲是过气女星却创出66亿元的“世纪退休”连蔡依林也是迷妹\";}s:7:\"ky_btjz\";a:6:{i:0;N;i:1;N;i:2;N;i:3;N;i:4;N;i:5;N;}s:5:\"ky_bt\";a:33:{i:0;s:18:\"﻿个人好好好\";i:1;s:18:\"﻿个人好好好\";i:2;s:18:\"﻿个人好好好\";i:3;s:18:\"﻿个人好好好\";i:4;s:15:\"就人好好好\";i:5;s:15:\"就人好好好\";i:6;s:15:\"就人好好好\";i:7;s:18:\"﻿个人好好好\";i:8;s:18:\"﻿个人好好好\";i:9;s:15:\"就人好好好\";i:10;s:18:\"﻿个人好好好\";i:11;s:18:\"﻿个人好好好\";i:12;s:18:\"﻿个人好好好\";i:13;s:18:\"﻿个人好好好\";i:14;s:18:\"﻿个人好好好\";i:15;s:18:\"﻿个人好好好\";i:16;s:15:\"就人好好好\";i:17;s:18:\"﻿个人好好好\";i:18;s:18:\"﻿个人好好好\";i:19;s:15:\"就人好好好\";i:20;s:15:\"就人好好好\";i:21;s:15:\"就人好好好\";i:22;s:18:\"﻿个人好好好\";i:23;s:18:\"﻿个人好好好\";i:24;s:18:\"﻿个人好好好\";i:25;s:18:\"﻿个人好好好\";i:26;s:18:\"﻿个人好好好\";i:27;s:15:\"就人好好好\";i:28;s:15:\"就人好好好\";i:29;s:15:\"就人好好好\";i:30;s:15:\"就人好好好\";i:31;s:15:\"就人好好好\";i:32;s:18:\"﻿个人好好好\";}s:8:\"cur_kytp\";a:1:{i:0;s:61:\"https://www.timg.site/allimg/110412/1_110412170248_19_lit.jpg\";}s:5:\"ky_xt\";a:15:{i:0;s:55:\"https://www.timg.site/allimg/131118/1-13111PU3540-L.jpg\";i:1;s:59:\"https://www.timg.site/allimg/130911/1_130911104508_1-lp.png\";i:2;s:57:\"https://www.timg.site/allimg/140123/1-1401230955040-L.jpg\";i:3;s:57:\"https://www.timg.site/allimg/140213/1-1402130931360-L.jpg\";i:4;s:59:\"https://www.timg.site/allimg/140224/1_140224105303_1-lp.jpg\";i:5;s:59:\"https://www.timg.site/allimg/1404