INSERT INTO `fym_user_detail_1` VALUES (492170, 'a:11:{s:7:\"ky_juzi\";a:9:{i:0;s:244:\"穿衣榜样呢，咱们也是介绍不少啦，无论是国外的时装精还是国内那些会穿的大花小花们，我们都知道，但凡穿得好看有风格的姑娘，都有一番自己的准则在。没错，今天这位也不例外~\";i:1;s:303:\"除了甲醛，香港消委会曾在多款睡眠面膜中检出含有的对羟基苯甲酸酯类防腐剂，引起了轩然大波。对羟基苯甲酸酯类物质又称尼泊金酯，包括甲酯、丙酯、丁酯、异丁酯等，能广泛抑制酵母菌、霉菌和细菌的活性，性质较稳定。\";i:2;s:369:\"除此之外，李梦男早年参演由王小帅导演执导的电影《十七岁的单车》就已斩获柏林电影节银熊奖，由其主演的《父亲爸爸》获得蒙特利尔电影节特别奖，主演的《散养时代》收获圣地亚哥电影节获影帝桂冠、奥本国际电影节最高奖观众选择奖以及休斯顿国际电影节最佳长片奖。\";i:3;s:240:\"备受瞩目的第二届中国国际进口博览会于11月5日在上海国家会展中心拉开帷幕，曾在首届进博会获上百家官方媒体争相报道的瑞士高端熨烫品牌——LAURASTAR，再次参展第二届进博会。\";i:4;s:109:\"▼2006年，《胭脂水粉》中凭倔强直率又贤惠能干的祝明蕙一角，获TVB周刊人气大奖\";i:5;s:50:\"▼以及，这是Tenet现场交出的霸气作品\";i:6;s:193:\"柏林一位老人因为拍摄潮范街拍走红。这位老潮男名叫GntherKrabbenhft，他在柏林科特布斯门站拍摄了一组街拍，一身英伦范儿的装扮，绅士又时尚。\";i:7;s:279:\"比如，广州桂格精细化工有限公司旗下的唇部护理品牌冰点已经推出了蜡笔系列，而对于细管形态的唇膏，其产品经理林鲁生也认为：“细管口红精致漂亮、涂抹方便。”并表示，公司今年有可能加码细管口红。\";i:8;s:401:\"本季时装秀以“theartoffallingapart”为主题，将传统与当代元素相结合，以凸显本季“融合”的内在理念。“在这一季创意里，我们讨论过去，但也将它带到了当下并探讨它对我们当今的影响：我们在哪里，我们身处如何的时代，”DiorHomme创意总监克里斯凡纳什解释道，“这是属于我们这一代人的时刻。”\";}s:7:\"ky_btjz\";a:6:{i:0;N;i:1;N;i:2;N;i:3;N;i:4;N;i:5;N;}s:5:\"ky_bt\";a:33:{i:0;s:17:\"个人好好好11\";i:1;s:17:\"个人好好好11\";i:2;s:17:\"就人好好好22\";i:3;s:17:\"就人好好好22\";i:4;s:17:\"个人好好好11\";i:5;s:17:\"就人好好好22\";i:6;s:17:\"个人好好好11\";i:7;s:17:\"个人好好好11\";i:8;s:17:\"个人好好好11\";i:9;s:17:\"个人好好好11\";i:10;s:17:\"就人好好好22\";i:11;s:17:\"个人好好好11\";i:12;s:17:\"就人好好好22\";i:13;s:17:\"个人好好好11\";i:14;s:17:\"就人好好好22\";i:15;s:17:\"就人好好好22\";i:16;s:17:\"个人好好好11\";i:17;s:17:\"就人好好好22\";i:18;s:17:\"个人好好好11\";i:19;s:17:\"就人好好好22\";i:20;s:17:\"就人好好好22\";i:21;s:17:\"个人好好好11\";i:22;s:17:\"就人好好好22\";i:23;s:17:\"就人好好好22\";i:24;s:17:\"就人好好好22\";i:25;s:17:\"就人好好好22\";i:26;s:17:\"个人好好好11\";i:27;s:17:\"个人好好好11\";i:28;s:17:\"就人好好好22\";i:29;s:17:\"个人好好好11\";i:30;s:17:\"就人好好好22\";i:31;s:17:\"就人好好好22\";i:32;s:17:\"就人好好好22\";}s:8:\"cur_kytp\";a:1:{i:0;s:58:\"https://www.timg.site/allimg/20191022/1571705826925785.jpg\";}s:5:\"ky_xt\";a:15:{i:0;s:55:\"https://www.timg.site/allimg/190527/1-1Z52F934500-L.jpg\";i:1;s:56:\"https://www.timg.site/a