INSERT INTO `fym_user_detail_1` VALUES (492172, 'a:11:{s:7:\"ky_juzi\";a:9:{i:0;s:273:\"此外，榜单报告称，互联网百强企业通过不断向各行各业“渗透”和“赋能”，推动云计算、大数据、物联网等信息通信技术与实体经济深入融合，培育新产业、新业态、新模式，支撑实体经济高质量发展。\";i:1;s:90:\"不少网友纷纷为消防英雄点赞，但是也有不少网友炮轰冉莹颖戏多。\";i:2;s:30:\"②主题名称：火星计划\";i:3;s:535:\"北京时间11月3日，201617NBA常规赛继续进行，亚特兰大老鹰坐镇主场迎来洛杉矶湖人的挑战。上半场，哈达威外线手感火烫帮助老鹰一度领先双位数，克拉克森率队曾追平比分，不过霍华德篮下连续杀伤，半场战罢，老鹰领先9分。下半场，拉塞尔、路威率队奋起直追，在第四节成功反超比分，关键时刻，尼克扬底角三分飙中杀死比赛，最终，湖人123116战胜老鹰结束三连败的同时，送给老鹰赛季首场失利。\";i:4;s:594:\"本次发布会上，1MORE万魔耳机仅凭借一款产品便引起了嘉宾和媒体的热切关注讨论。1MORE万魔耳机，中国原创新锐耳机品牌，成立时间虽然不算长，但已经累计了超过3800万条耳机销量，获得了超过288万条消费者好评。除了好音质，外观设计也是1MORE耳机的一大亮点。连续4年获得iF设计大奖，4年内已经累计获得了15项国内外设计大奖。积极扩展海内外市场，目前已经进军24个国家与地区。美国的重要媒体CNET、ConsumerReports也将1MORE耳机推荐给了消费者。\";i:5;s:578:\"白宇刘萌萌恋情被曝光。日前，有媒体曝出90后小生白，与曾出演《爱情公寓》诺澜一角的刘萌萌疑似陷入热恋。据爆料，白宇在情人节前独自一人抵达北京，随后来到刘萌萌的小区，在小区楼下徘徊许久后上楼，当夜在此留宿。第二天白宇清晨飞离北京，傍晚再度赶回刘萌萌家中，留宿女方家里。爆料视频里，白宇上身脱衣，在窗前喝水，刘萌萌走过来拉好窗帘，场景甜蜜有爱。如此亲密的关系，不禁让网友猜测二人正处于热恋期。\";i:6;s:276:\"从出身来看，王薇薇是个典型的白富美，出生在美国发达的曼哈顿上东区，父亲是高学历的公司总裁王澄清，母亲吴赤芳曾是联合国翻译员。她从小就跟着妈妈去参加欧洲各大时装周，接受了很好的时尚启蒙。\";i:7;s:390:\"从那时候起，田波在苏心越心里留下了深刻的印象，她开始关注与田波有关的消息，观看田波每一场直播。“他上班和下班的时候完全是两个人，我喜欢的是他下班踏实、诚恳的样子。”通过田波的直播，苏心越发现生活中的田波与工作时截然不同，私下一点也不“妩媚”，反而很老实，诚恳。\";i:8;s:973:\"此次XUZHI静态展是京东时尚与华裔设计师陈序之联合举办，京东时尚一直与华裔设计力量并肩前行，致力于搭建中西方时尚文化交流通路的愿景似乎正在开花结果。其实早在今年3月，京东时尚在上海举办的“设计质尚”设计师联合静态展上，陈序之就发布了2018秋冬新一季时装作品。此次双方再次携手登陆国际时尚舞台，不但极大地促进陈序之的个人品牌发展，而且展现了中国时尚的风采。陈序之表示：“京东时尚无疑拥有强大的消费者渠道，很高的品牌信任度，可以在营销等方面提供更多支持，是非常好的引路人。同时借助京东这个超级平台，能够让我跟很多顶级的设计师交流学习，大家资源互补，碰撞出更多更好的作品。京东时尚让我们近距离接触消费者，更能够理解消费者，希望从用户的角度设计出更优秀的东西出来。”\";}s:7:\"ky_btjz\";a:6:{i:0;N;i:1;N;i:2;N;i:3;N;i:4;N;i:5;N;}s:5:\"ky_bt\";a:33:{i:0;s:15:\"就人好好好\";i:1;s:15:\"就人好好好\";i:2;s:15:\"就人好好好\";i:3;s:18:\"﻿个人好好好\";i:4;s:18:\"﻿个人好好好\";i:5;s:15:\"就人好好好\";i:6;s:18:\"﻿个人好好好\";i:7;s:15:\"就人好好好\";i:8;s:15:\"就人好好好\";i:9;s:15:\"就人好好好\";i:10;s:18:\"﻿个人好好好\";i:11;s:15:\"就人好好好\";i:12;s:18:\"﻿个人好好好\";i:13;s:15:\"就人好好好\";i:14;s:15:\"就人好好好\";i:15;s:18:\"﻿个人好好好\";i:16;s:15:\"就人好好好\";i:17;s:15:\"就人好好好\";i:18;s:15:\"就人好好好\";i:19;s:18:\"﻿个人好好好\";i:20;s:15:\"