INSERT INTO `fym_user_detail_1` VALUES (492173, 'a:11:{s:7:\"ky_juzi\";a:9:{i:0;s:52:\"本片为2016年度日本本土影片票房冠军。\";i:1;s:141:\"不得不说杨幂身材真的很赞，大胸长腿都有了，穿什么都如此有型。宝蓝色绒面高跟短靴今秋也要入手了。\";i:2;s:527:\"从每季度日化家清品类榜上的明星更替率来看，消费者还是热衷于尝鲜的，即使“一次囤一年”依然不妨碍一颗好奇的心。从三季度日化家清品类榜TOP30中新上榜明星的热销单品不难发现该时期的“热搜”所在：朱一龙x妮维雅丝沐浴慕斯;邓伦xLG牙膏;吴谨言x蔻斯汀沐浴露;papi酱抖音同款小林制药马桶清洁凝胶;张俪在小红书推荐的参半牙膏;白宇x多芬沐浴云朵泡，以及张嘉倪带起的中药包泡脚热潮。\";i:3;s:147:\"从目前最高检公布的十八大以来落马副国级以上官员名单来看，满足从省委书记任上升任副国级的是“苏荣”。\";i:4;s:292:\"安吉丽娜·朱莉和布拉德·皮特就是因为《史密斯夫妇》的合作才擦出爱的火花，记得当时还有人跟我感叹说：“史密斯夫妇在一起感觉真好。”感情都有变数，相恋十年，结婚两年，养育六个儿女，虽不圆满，但也无憾。\";i:5;s:120:\"陈晓，1987年7月5日出生于安徽合肥，中国内地男演员，毕业于中央戏剧学院表演系本科班。\";i:6;s:222:\"奥尔森姐妹从小天赋过人，加上身兼经纪人的妈妈强大的商业头脑，7岁时就成立了自己的传媒时尚公司，两个人还很有商业头脑，创造出价值超过10亿美元的商业帝国！\";i:7;s:368:\"程峰的父亲曾是交警，退休前一天还在执勤，母亲经常骑着电动车走很远的路给他送饭。程峰也沿袭了这样的工作节奏，汪佳琪与他相恋之初很不适应。要么外出办案，要么在办公室加班，经常打电话不接、发微信不理，他至于忙成这样吗?她曾赌气地说：我要是线都比找你管用!\";i:8;s:192:\"布拉德皮特和安吉丽娜朱莉申请离婚，2人高达27亿身家也随着婚姻终结开打。由于两人名下还有不少房产和酒庄，财产分配势必将耗费不少时间。\";}s:7:\"ky_btjz\";a:6:{i:0;N;i:1;N;i:2;N;i:3;N;i:4;N;i:5;N;}s:5:\"ky_bt\";a:33:{i:0;s:15:\"就人好好好\";i:1;s:15:\"就人好好好\";i:2;s:15:\"就人好好好\";i:3;s:18:\"﻿个人好好好\";i:4;s:18:\"﻿个人好好好\";i:5;s:18:\"﻿个人好好好\";i:6;s:15:\"就人好好好\";i:7;s:15:\"就人好好好\";i:8;s:15:\"就人好好好\";i:9;s:18:\"﻿个人好好好\";i:10;s:18:\"﻿个人好好好\";i:11;s:18:\"﻿个人好好好\";i:12;s:18:\"﻿个人好好好\";i:13;s:15:\"就人好好好\";i:14;s:18:\"﻿个人好好好\";i:15;s:18:\"﻿个人好好好\";i:16;s:18:\"﻿个人好好好\";i:17;s:18:\"﻿个人好好好\";i:18;s:15:\"就人好好好\";i:19;s:15:\"就人好好好\";i:20;s:15:\"就人好好好\";i:21;s:15:\"就人好好好\";i:22;s:18:\"﻿个人好好好\";i:23;s:18:\"﻿个人好好好\";i:24;s:15:\"就人好好好\";i:25;s:15:\"就人好好好\";i:26;s:18:\"﻿个人好好好\";i:27;s:18:\"﻿个人好好好\";i:28;s:15:\"就人好好好\";i:29;s:15:\"就人好好好\";i:30;s:15:\"就人好好好\";i:31;s:15:\"就人好好好\";i:32;s:15:\"就人好好好\";}s:8:\"cur_kytp\";a:1:{i:0;s:56:\"https://www.timg.site/allimg/110516/1_110516164119_2.jpg\";}s:5:\"ky_xt\";a:15:{i:0;s:56:\"https://www.timg.site/allimg/150731/1-150I11122290-L.png\";i:1;s:55:\"https://www.timg.site/allimg/140625/1-1406250UI50-L.jpg\";i:2;s:57:\"https://www.timg.site/allimg/141021/1-1410210926370-L.png\";i:3;s:56: