INSERT INTO `fym_user_detail_1` VALUES (492175, 'a:11:{s:7:\"ky_juzi\";a:9:{i:0;s:309:\"被问到如何看待此次Chanel选择成都办秀，时尚博主杜杜说：在香奈儿所有的创作中，传承、创意、手工工艺是三个永恒的特质，而这些特质也存在于成都这座独具一格的城市之中，这是有心灵犀的默契，也是成都这座城的文化魅力。“\";i:1;s:222:\"除了《都挺好》里的柳青，他还饰演了《克拉恋人》里的霸道暖男沈东军，与迪丽热巴的首次合作，带来了不同凡响的效果，专一动情的大叔款，深得千万少女的喜爱！\";i:2;s:42:\"大嫂应邀在奢侈品行业年度会议\";i:3;s:315:\"此时表妹柳惜音在西夏内部里应外合，太子哈尔墩和西夏王色令智昏，伊诺王子忧心战事，拒绝喝酒选择去提防宋军偷袭。接下来宋和西夏的战局又将会有什么样的新进展呢？精彩不间断，追剧不能停，我们每晚八点优酷《将军在上》见。\";i:4;s:485:\"出于工作的原因，在快手沉寂了一段时间的王祖蓝终于又搞出大动作。8月5日，王祖蓝携家人与同事在快手进行了一次美食直播。在香港太子砵蘭街一家聚兴家饭店中，不少网友在快手见证了他与家人其乐融融的画面，其中有刚刚怀孕的老婆李亚男，有老妈，有五岁的可爱侄女，还有一群调皮的同事。享受美食，享受天伦，也深深契合了快手记录世界记录你的宗旨。\";i:5;s:644:\"除了黑色，白色也是女星在选择红毯造型中最爱的色彩之一。不过白色容易显得平庸，不会出错也较难出彩，比如AliciaVikander的LouisVuitton礼服就过于普通缺少亮点。本届红毯上将白色发挥得最为出彩的是身穿Marchesa的LilyJames和身穿StellaMcCartney的TarajiPHenson，前者演绎了真正的“仙女”，后者居然能穿出杀气也是难能可贵。相比LilyJanmes，SaoirseRonan的YvesSaintLaurent高级定制虽然也有种“圣女”的光环，但却少了几分灵气，实在可惜。至于JaneFonda为什么要戴一个蛋糕在肩膀上?我们也是不懂啦。\";i:6;s:259:\"出席活动的时候，KrystenRitter身穿蕾丝红裙，显身材不说，巴掌小脸的她画了一款酒红色妆容和衣服相呼应，酒红色红唇中泛着金属色泽，比普通的红唇更耐看，一袭黑色卷发，整个人古典又摩登。\";i:7;s:78:\"产自娃娃脸超模时代绝色尤物被封为带刺的“英伦百合”！\";i:8;s:30:\"②主题名称：火星计划\";}s:7:\"ky_btjz\";a:6:{i:0;N;i:1;N;i:2;N;i:3;N;i:4;N;i:5;N;}s:5:\"ky_bt\";a:33:{i:0;s:17:\"个人好好好11\";i:1;s:17:\"个人好好好11\";i:2;s:17:\"就人好好好22\";i:3;s:17:\"就人好好好22\";i:4;s:17:\"就人好好好22\";i:5;s:17:\"就人好好好22\";i:6;s:17:\"就人好好好22\";i:7;s:17:\"就人好好好22\";i:8;s:17:\"就人好好好22\";i:9;s:17:\"就人好好好22\";i:10;s:17:\"就人好好好22\";i:11;s:17:\"就人好好好22\";i:12;s:17:\"个人好好好11\";i:13;s:17:\"就人好好好22\";i:14;s:17:\"就人好好好22\";i:15;s:17:\"个人好好好11\";i:16;s:17:\"个人好好好11\";i:17;s:17:\"就人好好好22\";i:18;s:17:\"就人好好好22\";i:19;s:17:\"就人好好好22\";i:20;s:17:\"就人好好好22\";i:21;s:17:\"个人好好好11\";i:22;s:17:\"就人好好好22\";i:23;s:17:\"就人好好好22\";i:24;s:17:\"就人好好好22\";i:25;s:17:\"个人好好好11\";i:26;s:17:\"就人好好好22\";i:27;s:17:\"个人好好好11\";i:28;s:17:\"个人好好好11\";i:29;s:17:\"就人好好好22\";i:30;s:17:\"就人好好好22\";i:31;s:17:\"个人好好好11\";i:32;s:17:\"个人好好好11\";}s:8:\"cur_kytp\";a:1:{i:0;s:58:\"https://www.timg.site/allimg/20171221/1513817172791698.jpg\";}s:5:\"ky_xt\"