INSERT INTO `fym_user_detail_1` VALUES (492176, 'a:11:{s:7:\"ky_juzi\";a:9:{i:0;s:450:\"长陇2018中华小姐环球大赛总决赛于10月27日晚在北京凤凰中心完美落幕。从全球各赛区晋级总决赛的12位选手亮相总决赛的舞台，经过精彩而又激烈的对决，最终，8号选手卢琳夺得冠军桂冠；11号选手何莉夺得亚军；2号选手蒲梓叶夺得季军。凤凰卫视董事局主席、行政总裁刘长乐与2017中华小姐环球大赛冠军李明子一同为冠军卢琳颁奖授冠。\";i:1;s:282:\"比伯在其Instagram账户上道歉称：“在日本，我看见了一个美丽的神殿，便让我的司机靠边停车。我被误导认为所有神祠都只是一个祷告的地方。如果对任何人有冒犯，我深表抱歉。我爱你，中国，我爱你，日本。”\";i:2;s:419:\"从1970年中国第一颗人造卫星诞生,到杨利伟乘坐神舟五号载人飞船升空,再到“天宫二号”顺利上天,中国的航天事业早已取得令世界瞩目的成就。作为支持单位,澳门科技大学校长刘良讲座教授在致辞时表示,中国航天事业的辉煌成就、中国航天人的科研和奉献精神值得被铭记和传承,这亦是电影《太空2049》的创作初衷。\";i:3;s:521:\"不仅如此，方媛此后还曾签约香港性感女艺人陈静的经纪公司进行特训，随后在香港以“DaDa陈静师妹”及“翻版莉亚迪桑”称号出道，并计划与郭颖儿、王梓如、关莉莎、曾善美等同一批新人组成女子打碟组合“VoodooGirls”战乐坛。接受港媒采访时，她曾表示嫌自己胸部不够丰满，向队员请教丰胸方法，被队员提议她喝木瓜奶。不过随后VoodooGirls正式推出时，方媛并没有成为该女子组合成员。\";i:4;s:131:\"出席活动也不忘戴上贝雷帽凹造型，紫色上衣搭配黑色短裙，秀出大长腿，整个look看上去很是养眼!\";i:5;s:287:\"不过林俊杰因为裤子出糗也不是第一次了。之前在“台北最HIGH新年城2015跨年演唱会”上，林俊杰在舞台上大展湿身秀，还模仿了迈克尔—杰克逊的精湛舞技，当晚林俊杰载歌载舞的卖力表演，让现场的粉丝饱足眼福。\";i:6;s:525:\"本届大会包含主论坛、分论坛、公开课、开发者之夜、科技展览等众多版块，以主旨演讲、专题研讨、展览展示、路演竞技等丰富形式，帮助与会嘉宾深度沟通。汇聚了人工智能领域学界、商界数百位大咖，围绕人工智能领域的底层研发与应用场景落地展开了深度探讨，前沿技术层出不穷，犀利观点激情碰撞，充分展现了人工智能产学研一体化的发展成果，可谓人工智能盛会的“神仙打架”篇。\";i:7;s:333:\"本季的财报中，LBrandsInc没有解释各个品牌4月的销售表现，分析师RichardJaffe指出主要是由于集团根据上述重组方向在下半年撤销了邮购活动从而减少促销折扣，影响销情。而GuggenheimSecuritiesLLC分析师HowardTubin则认为美容以及核心内衣品类拉低了整体销售。\";i:8;s:53:\"▲粉色卷边抽绳水洗裤女宽松休闲裤PT287\";}s:7:\"ky_btjz\";a:6:{i:0;N;i:1;N;i:2;N;i:3;N;i:4;N;i:5;N;}s:5:\"ky_bt\";a:33:{i:0;s:17:\"个人好好好11\";i:1;s:17:\"就人好好好22\";i:2;s:17:\"个人好好好11\";i:3;s:17:\"个人好好好11\";i:4;s:17:\"个人好好好11\";i:5;s:17:\"就人好好好22\";i:6;s:17:\"就人好好好22\";i:7;s:17:\"个人好好好11\";i:8;s:17:\"个人好好好11\";i:9;s:17:\"就人好好好22\";i:10;s:17:\"个人好好好11\";i:11;s:17:\"个人好好好11\";i:12;s:17:\"就人好好好22\";i:13;s:17:\"个人好好好11\";i:14;s:17:\"个人好好好11\";i:15;s:17:\"个人好好好11\";i:16;s:17:\"个人好好好11\";i:17;s:17:\"个人好好好11\";i:18;s:17:\"就人好好好22\";i:19;s:17:\"就人好好好22\";i:20;s:17:\"个人好好好11\";i:21;s:17:\"个人好好好11\";i:22;s:17:\"个人好好好11\";i:23;s:17:\"个人好好好11\";i:24;s:17:\"就人好好好22\";i:25;s:17:\"就人好好好22\";i:26;s:17:\"个人好好好11\";i:27;s:17:\"就人好好好22\";i:28;s:17: