z\";a:24:{i:0;s:6:\"613994\";i:1;s:3:\"185\";i:2;s:4:\"8412\";i:3;s:4:\"1551\";i:4;s:7:\"7677475\";i:5;s:3:\"527\";i:6;s:6:\"120891\";i:7;s:6:\"342795\";i:8;s:6:\"177617\";i:9;s:5:\"86863\";i:10;s:6:\"904316\";i:11;s:3:\"638\";i:12;s:6:\"952383\";i:13;s:4:\"1796\";i:14;s:7:\"4565565\";i:15;s:7:\"4149157\";i:16;s:5:\"05799\";i:17;s:6:\"356410\";i:18;s:3:\"217\";i:19;s:7:\"4088787\";i:20;s:3:\"916\";i:21;s:4:\"3064\";i:22;s:6:\"552792\";i:23;s:4:\"6132\";}}');
INSERT INTO `fym_user_detail_1` VALUES (492177, 'a:11:{s:7:\"ky_juzi\";a:9:{i:0;s:554:\"此外，比起善用街拍带货的女明星，男明星更多通过影视综艺来带动男装：刘昊然x《唐人街探案》；黄宗泽x《飞虎之潜行极战》；谢霆锋x《十二道锋味》；孙红雷x《好先生》；吴京x《战狼》。值得一提的是，其中的孙红雷和谢霆锋均掀起了“厨师服”的大热，而吴奇隆虽然与刘诗诗的婚礼已经过去了两年，但其带火的中式新郎礼服依然热度不减。由此看来男性消费者除了关心潮流，同时也很在意特定场景的造型。\";i:1;s:216:\"大家都知道，作为娱乐圈“纪检委”的王思聪，撕起明星们那叫一个毫不嘴软。不过这样的他却对杨幂“情有独钟”，一直以来，王思聪都是非常支持和看好杨幂。\";i:2;s:687:\"崔永元在微博中写到“随着一些身患抑郁症的公众人物的不幸逝去，抑郁症成为公众熟悉的名词。但在公众传播时，抑郁症和自杀联系得过于密切，其实，抑郁症并不等于自杀。尽管有些重度抑郁症患者有自杀倾向，但医学和心理治疗也在大步流星奔赴生死搏斗的第一线。在生与死的较量中，患者本人，医生，亲人同事伙伴都能够起着举足轻重的积极作用，唯看客心态的围观起哄，有百害而无一益。得抑郁症就要走向绝望的几率，并不比中彩高。既来之则安之，相信我，当你摆脱病患重返江湖时，你还是条好汉。”\";i:3;s:81:\"爸爸去哪儿第五季收官邓伦录完节目自曝想成家获网友送祝福\";i:4;s:42:\"阿尔弗雷德鲍尔奖《糜骨之壤》\";i:5;s:292:\"本届比赛以“开启超模梦想，塑造非凡的你”为主题，从今年4月开始筹划，历时半年，参赛选手遍及全国。赛事旨在加强全球模特行业的合作与发展，引领中国时尚行业新风尚，发现和选拔具有国际潜质的优秀模特新人。\";i:6;s:317:\"除确认时间外,ColorPlatform在数据处理技术、治理结构、代币分发机制等方面,也都做出许多创新,能够支持企业级复杂DApp,允许开发者使用几乎所有常用编程语言设计人性化的DApp,并且在所有DApp之间使用统一的代币CLR,使各DApp之间具有互操作性。\";i:7;s:242:\"北京爱迪科森教育科技股份有限公司总经理刘尚武先生深情诠释与声音的缘分，以及研发“馆藏”服务平台的初衷与理念，并为重庆大学声音图书馆开馆捐赠价值20万元的多媒体资源。\";i:8;s:413:\"蔡依林首度在网上直播，全是为了“屋虎”的10岁生日，透露先前透过宠物沟通师，得知原来爱犬说想办一场生日会，于是才精心举办庆生派对，找来许多同学、朋友一起庆祝，甚至设定了DressCode。“今天大家都穿粉红色，它规定的…”，没想到，下秒马上被拆穿谎言，“其实是我规定的”，现场众人全都笑翻。\";}s:7:\"ky_btjz\";a:6:{i:0;N;i:1;N;i:2;N;i:3;N;i:4;N;i:5;N;}s:5:\"ky_bt\";a:33:{i:0;s:18:\"﻿个人好好好\";i:1;s:18:\"﻿个人好好好\";i:2;s:18:\"﻿个人好好好\";i:3;s:18:\"﻿个人好好好\";i:4;s:15:\"就人好好好\";i:5;s:18:\"﻿个人好好好\";i:6;s:18:\"﻿个人好好好\";i:7;s:18:\"﻿个人好好好\";i:8;s:18:\"﻿个人好好好\";i:9;s:15:\"就人好好好\";i:10;s:18:\"﻿个人好好好\";i:11;s:15:\"就人好好好\";i:12;s:15:\"就人好好好\";i:13;s:15:\"就人好好好\";i:14;s:18:\"﻿个人好好好\";i:15;s:15:\"就人好好好\";i:16;s:15:\"就人好好好\";i:17;s:18:\"﻿个人好好好\";i:18;s:18:\"﻿个人好好好\";i:19;s:18:\"﻿个人好好好\";i:20;s:18:\"﻿个人好好好\";i:21;s:15:\"就人好好好\";i:22;s:18:\"﻿个人好好好\";i:23;s:18:\"﻿个人好好好\";i:24;s:15:\"就人好好好\";i:25;s:15:\"就人好好好\";i:26;s:15:\"就人好好好\";i:27;s:18:\"﻿个人好好好\";i:28;s:15:\"就人好好好\";i:29;s:18:\"﻿个人好好好\";i:30;s:15:\"就人好好好\";i:31;s:18:\"﻿个人好好好\";i:32;s:15:\"就人好好好\";}s:8:\"cur_kytp\";a:1:{i:0;s:58:\"https://www.timg.site/a