INSERT INTO `fym_user_detail_1` VALUES (492178, 'a:11:{s:7:\"ky_juzi\";a:9:{i:0;s:435:\"出身于低下阶层，自小恃著几分美貌练成各种媚功，利用美色从男人身上讨便宜。久而久之，缪思渐渐变得贪慕虚荣，养成不劳而获心态。两年前，缪思以美色勾引老板包养自己，自觉生活幸福无忧。正当缪思以为遇上真命天子，甘愿为男友付出真心并且诞下女儿，岂料男友竟以缪思的银行户口用洗黑钱，连累她被捕判监一年。\";i:1;s:246:\"本以为宋茜穿52万的裙子出席活动够壕了，而刚生完二胎的张嘉倪也出席了慈善芭莎晚宴，不仅仅身材恢复的很好，造型也是相当大方得体，最让人亮眼的是她把价值160万的珠宝戴在身上!\";i:2;s:213:\"此外，饿了么还与麦隆咖啡联手，为时装周后台定制了专用“随圾应变”回收垃圾桶，用于回收时装周来宾们喝完的咖啡杯用实际行动，让一次性包装不再流浪。\";i:3;s:54:\"奔跑吧鹿晗心跳加速与迪丽热巴深情对视\";i:4;s:244:\"被PeopleMagazine选为世界年度100大最美丽女人，还是性感榜前十的模特，拥有令人惊叹的魔鬼身材，她曾表示每日必须健身两次，并定期进行为期10天的果汁排毒疗法，来维持自己的身材。\";i:5;s:444:\"安吉丽娜朱莉在2015年自导自演电影《海岸情深》，找来布拉德皮特合作演出一对怨偶，当时就曾被外界怀疑是否在叙述自己的婚姻，也透露有很多朋友担心他们会拍到出问题。朱莉在接受《Vogue》采访时则解释：“这不是自传，布拉德跟我有我们自己的问题。但，如果不是角色多少和我们的问题有点相近，就没办法完成这部电影了。”\";i:6;s:118:\"▲佳俊老师、李炎宗老师、Akin老师、肖娜女士、瀚威铭轩副总经理杨莲晟女士、周毅老师\";i:7;s:129:\"病床推进重症室的时候，我附在笑笑耳边祝祷：宝贝你一定要好好的出来。眼泪忍不住刷刷地流。\";i:8;s:114:\"（图为上海市政协原主席、上海市工业经济联合会原会长、教授级高级工程师蒋以任）\";}s:7:\"ky_btjz\";a:6:{i:0;N;i:1;N;i:2;N;i:3;N;i:4;N;i:5;N;}s:5:\"ky_bt\";a:33:{i:0;s:18:\"﻿个人好好好\";i:1;s:18:\"﻿个人好好好\";i:2;s:15:\"就人好好好\";i:3;s:15:\"就人好好好\";i:4;s:15:\"就人好好好\";i:5;s:18:\"﻿个人好好好\";i:6;s:18:\"﻿个人好好好\";i:7;s:18:\"﻿个人好好好\";i:8;s:18:\"﻿个人好好好\";i:9;s:15:\"就人好好好\";i:10;s:18:\"﻿个人好好好\";i:11;s:18:\"﻿个人好好好\";i:12;s:18:\"﻿个人好好好\";i:13;s:15:\"就人好好好\";i:14;s:15:\"就人好好好\";i:15;s:18:\"﻿个人好好好\";i:16;s:18:\"﻿个人好好好\";i:17;s:18:\"﻿个人好好好\";i:18;s:18:\"﻿个人好好好\";i:19;s:15:\"就人好好好\";i:20;s:15:\"就人好好好\";i:21;s:15:\"就人好好好\";i:22;s:15:\"就人好好好\";i:23;s:15:\"就人好好好\";i:24;s:18:\"﻿个人好好好\";i:25;s:15:\"就人好好好\";i:26;s:15:\"就人好好好\";i:27;s:18:\"﻿个人好好好\";i:28;s:18:\"﻿个人好好好\";i:29;s:15:\"就人好好好\";i:30;s:15:\"就人好好好\";i:31;s:18:\"﻿个人好好好\";i:32;s:18:\"﻿个人好好好\";}s:8:\"cur_kytp\";a:1:{i:0;s:58:\"https://www.timg.site/allimg/20180323/1521769522550935.jpg\";}s:5:\"ky_xt\";a:15:{i:0;s:48:\"https://www.timg.site/140924/1-1409240S639C0.png\";i:1;s:49:\"https://www.timg.site/110826/1-110R6095101230.jpg\";i:2;s:60:\"https://www.timg.site/allimg/110324/1_110324090339_1_lit.jpg\";i:3;s:49:\"https://www.timg.site/1101