INSERT INTO `fym_user_detail_1` VALUES (492179, 'a:11:{s:7:\"ky_juzi\";a:9:{i:0;s:122:\"除了固件升级外，Anker在本次发布会上还推出了具有全新色彩和材质和制作工艺的充电产品。\";i:1;s:57:\"此外王秀琳还被拍到外出买菜给霍启文做饭\";i:2;s:709:\"本届开渔节由中共惠来县委宣传部指导，惠来县海洋与渔业局主办，惠来县文明办、惠来县文学艺术界联合会协办，惠来县靖海镇人民政府承办。并获得中国人民财产保险股份有限公司揭阳市分公司、中国移动通信集团广东有限公司揭阳分公司、惠来县农村信用合作联社、中国邮政集团公司广东省惠来县分公司的支持，同时，活动现场还邀请到了CCTV中央电视台农业频道《乡土》、广东广播电视台珠江频道《今日关注》、广东卫视《新闻联播》、《新浪广东网》、《腾讯网》等媒体的支持，触电新闻直播为本届开渔节进行全程直播。\";i:3;s:312:\"不久，苏醒将此条微博删除。在晚上的时候，他再次发微博，用藏头诗表示此事的确存在，并暗示李炜是“小三”，藏头诗称：“微博为公司而撤，打小三绝不手软。”事件另一方的李炜也用藏头诗回应“还击”，暗示苏醒为“小人”。\";i:4;s:237:\"初秋，小雨，西华师大体育场上，大四学生张爽正在倒立行走，膝盖处夹着一个排球，师兄师弟在一旁为其喝彩。他就是世界上50米双脚夹球倒立行走速度最快的人，只用时2609秒。\";i:5;s:456:\"除此之外，承兴影业在打造电影项目的同时，基于对流行音乐的一种情怀，承兴影业将与著名主持人林海合作一档《三声有幸》节目，集结华语乐坛顶尖的新生力量，打造2018年华语音乐的最强文化访谈类的IP，将在内地、香港和台湾实地探访和拍摄，以短视频以及纪录片的呈现方式配合线下的展览和演唱会活动，实现对流行音乐新视角的解读。\";i:6;s:15:\"安全混合云\";i:7;s:27:\"（SynergiesCTO熊崇纬）\";i:8;s:453:\"此时上海总部旅游体验师郑楚向女友陈姗姗求婚，却被其以恨铁不成钢为由拒绝，陷入事业和感情困局。空降上司苏芒因为各种传闻在新环境中陷入孤立无援的境地，但热心的郑楚走进了她的生活。两人从欢喜冤家到相濡以沫，“女魔头”和刺头下属从“冰与火”的对抗到相爱。办公室恋情和来历不明的孩子考验着一对重燃爱情希望的恋人。\";}s:7:\"ky_btjz\";a:6:{i:0;N;i:1;N;i:2;N;i:3;N;i:4;N;i:5;N;}s:5:\"ky_bt\";a:33:{i:0;s:18:\"﻿个人好好好\";i:1;s:18:\"﻿个人好好好\";i:2;s:18:\"﻿个人好好好\";i:3;s:18:\"﻿个人好好好\";i:4;s:15:\"就人好好好\";i:5;s:15:\"就人好好好\";i:6;s:15:\"就人好好好\";i:7;s:15:\"就人好好好\";i:8;s:15:\"就人好好好\";i:9;s:18:\"﻿个人好好好\";i:10;s:15:\"就人好好好\";i:11;s:18:\"﻿个人好好好\";i:12;s:15:\"就人好好好\";i:13;s:18:\"﻿个人好好好\";i:14;s:15:\"就人好好好\";i:15;s:15:\"就人好好好\";i:16;s:18:\"﻿个人好好好\";i:17;s:15:\"就人好好好\";i:18;s:15:\"就人好好好\";i:19;s:15:\"就人好好好\";i:20;s:15:\"就人好好好\";i:21;s:15:\"就人好好好\";i:22;s:18:\"﻿个人好好好\";i:23;s:18:\"﻿个人好好好\";i:24;s:15:\"就人好好好\";i:25;s:18:\"﻿个人好好好\";i:26;s:15:\"就人好好好\";i:27;s:18:\"﻿个人好好好\";i:28;s:15:\"就人好好好\";i:29;s:15:\"就人好好好\";i:30;s:18:\"﻿个人好好好\";i:31;s:18:\"﻿个人好好好\";i:32;s:18:\"﻿个人好好好\";}s:8:\"cur_kytp\";a:1:{i:0;s:56:\"https://www.timg.site/allimg/110726/1_110726093032_1.jpg\";}s:5:\"ky_xt\";a:15:{i:0;s:59:\"https://www.timg.site/allimg/110625/1_110625110431_1-lp.png\";i:1;s:47:\"https://www.timg.site/121029/1-1