INSERT INTO `fym_user_detail_1` VALUES (492180, 'a:11:{s:7:\"ky_juzi\";a:9:{i:0;s:276:\"出道了三十二年，淳于珊珊是一个既燃又真的实力派演员，凭借丰富的表演经验、扎实的表演功底为各种角色增添了很强的质感，尽管有的反派角色不讨喜，淳于珊珊依旧全力以赴，用精湛的演技征服了观众。\";i:1;s:226:\"此次《事与愿违》的现场live不仅延续“开口跪”模式，更与枫叶、枯木等舞台元素产生音乐效应，许靖韵用实力唱功与舞美背景相结合，共同讲述一段“离心”情感故事。\";i:2;s:294:\"陈小春直言很喜欢刘畊宏的女儿小泡芙，也很想要二胎，也想生一个小可爱，才能人生圆满，并在采访里多次表示想生一个女儿，但是陈小春也很温柔，表示老婆怀胎十月也是非常辛苦的事情，所以生孩子都还得看应采儿。\";i:3;s:48:\"比赛现场原创歌手弹奏吉他深情演唱\";i:4;s:36:\"并且，本色演出腹黑属性。\";i:5;s:231:\"从口号可以看出其受众人群以华人为主，APP首页的城市布局可以看出，热门目的地中10个里面只有4个是国内城市推荐，由此决定了一家民宿的小众定位，即华人民宿预订为主。\";i:6;s:351:\"称歌手张敬轩突然退出内地歌唱比赛《歌手》，至今还没有作出任何回应，但1月15日晚七时多，他在司机接载下，由住所驶往中环一间健康食品店购物，期间只见他满面愁容，似是受近日的负面传闻影响，没过多久就买下两袋战利品，匆匆上车离开，没有理会记者。\";i:7;s:410:\"长微博中，张艺兴以成熟的口吻喊17岁的自己为“小兔崽子”，回忆自己那些年用汗水填满清晨黑夜的努力，虽然无数次地怀疑自己，但如今能够在国外榜单上取得这样的成绩，有知足，也有继续奋起努力的决心。而写到自己的粉丝们，张艺兴却说出了“根本做不到”这样的话，曾经的豪言壮语让人红了眼眶。\";i:8;s:183:\"从图上看，杨紫似乎想要表演一段走秀给男友看，秦俊杰连忙摆手拒绝。但是这也并不影响杨紫想要表演的心，自己在男友面前走了起来。\";}s:7:\"ky_btjz\";a:6:{i:0;N;i:1;N;i:2;N;i:3;N;i:4;N;i:5;N;}s:5:\"ky_bt\";a:33:{i:0;s:17:\"就人好好好22\";i:1;s:17:\"就人好好好22\";i:2;s:17:\"就人好好好22\";i:3;s:17:\"就人好好好22\";i:4;s:17:\"个人好好好11\";i:5;s:17:\"个人好好好11\";i:6;s:17:\"个人好好好11\";i:7;s:17:\"个人好好好11\";i:8;s:17:\"个人好好好11\";i:9;s:17:\"个人好好好11\";i:10;s:17:\"就人好好好22\";i:11;s:17:\"就人好好好22\";i:12;s:17:\"个人好好好11\";i:13;s:17:\"个人好好好11\";i:14;s:17:\"个人好好好11\";i:15;s:17:\"就人好好好22\";i:16;s:17:\"就人好好好22\";i:17;s:17:\"就人好好好22\";i:18;s:17:\"就人好好好22\";i:19;s:17:\"就人好好好22\";i:20;s:17:\"就人好好好22\";i:21;s:17:\"个人好好好11\";i:22;s:17:\"就人好好好22\";i:23;s:17:\"就人好好好22\";i:24;s:17:\"个人好好好11\";i:25;s:17:\"个人好好好11\";i:26;s:17:\"个人好好好11\";i:27;s:17:\"就人好好好22\";i:28;s:17:\"就人好好好22\";i:29;s:17:\"个人好好好11\";i:30;s:17:\"个人好好好11\";i:31;s:17:\"就人好好好22\";i:32;s:17:\"就人好好好22\";}s:8:\"cur_kytp\";a:1:{i:0;s:56:\"https://www.timg.site/allimg/100316/1_100316103047_3.jpg\";}s:5:\"ky_xt\";a:15:{i:0;s:59:\"https://www.timg.site/allimg/120618/1_120618011011_1-lp.jpg\";i:1;s:59:\"https://www.timg.site/allimg/111118/1_111118091427_1-lp.png\";i:2;s:57:\"https://www.timg.site/allimg/1