INSERT INTO `fym_user_detail_1` VALUES (492181, 'a:11:{s:7:\"ky_juzi\";a:9:{i:0;s:69:\"陈乔恩披上斗篷外套可爱得像个古灵精怪的小女巫。\";i:1;s:291:\"程峰来到视频侦查支队的两年，正是武汉市公安局视侦技术提档升级的关键时期。今年5月20日，他和汪佳琪准备领证，却因他临时加班而改期。七夕领证的计划，也因加班打乱。9月30日，他好不容易腾出半天时间领了证。\";i:2;s:60:\"不过，这个挑战承担的是什么只有自己清楚。\";i:3;s:48:\"（华米科技新品发布会邀请函礼品）\";i:4;s:264:\"财报显示,云集会员达到1077万人,相较于去年同期的463万人,同比增长1321%。截至2019年6月30日,云集交易会员在过去的12个月从366万增至823万,同比增长1251%;云集第二季度总GMV达到了82亿人民币,同比增长464%。\";i:5;s:337:\"笔者拿到的这台麦本本大麦E526的屏幕产自京东方，因为批次不同，或许有些朋友拿到的不是京东方屏幕，这也没什么好奇怪的。这是一块156英寸的雾面屏，好处是能减少反光，在光线复杂的户外、背对光源的室内也可以正常使用电脑，减少对眼睛的伤害。\";i:6;s:428:\"本次大赛是阿里云创新中心和建邺区高新技术产业开发区，面向科技创新创业群体，共同搭建的系列创新创业赋能平台之一，此前双方先后合作举办了未来城市产业峰会（创峰会·南京站）、赛道明星班等系列活动，从线下孵化、资源聚集、优秀项目发掘、赋能加速等方面为创新创业者提供全方位、全生命周期的服务体系。\";i:7;s:346:\"除此之外，本次99划算节华硕还为用户提供了预售五大特权，包括付定金现金红包立减、优先发货、一对一远程指导和一年换新服务，9月9日付尾款还可以抢豪华各种豪华礼品，例如ROG信仰双肩背包、智能开关、智能护眼灯等产品，给用户带来更多实打实的优惠。\";i:8;s:78:\"陈志朋最新消息透视装毛披肩雨靴装扮再次刷新辣眼睛下限\";}s:7:\"ky_btjz\";a:6:{i:0;N;i:1;N;i:2;N;i:3;N;i:4;N;i:5;N;}s:5:\"ky_bt\";a:33:{i:0;s:18:\"﻿个人好好好\";i:1;s:18:\"﻿个人好好好\";i:2;s:15:\"就人好好好\";i:3;s:18:\"﻿个人好好好\";i:4;s:18:\"﻿个人好好好\";i:5;s:15:\"就人好好好\";i:6;s:18:\"﻿个人好好好\";i:7;s:15:\"就人好好好\";i:8;s:18:\"﻿个人好好好\";i:9;s:15:\"就人好好好\";i:10;s:18:\"﻿个人好好好\";i:11;s:15:\"就人好好好\";i:12;s:15:\"就人好好好\";i:13;s:18:\"﻿个人好好好\";i:14;s:15:\"就人好好好\";i:15;s:15:\"就人好好好\";i:16;s:15:\"就人好好好\";i:17;s:18:\"﻿个人好好好\";i:18;s:18:\"﻿个人好好好\";i:19;s:18:\"﻿个人好好好\";i:20;s:15:\"就人好好好\";i:21;s:15:\"就人好好好\";i:22;s:15:\"就人好好好\";i:23;s:15:\"就人好好好\";i:24;s:18:\"﻿个人好好好\";i:25;s:15:\"就人好好好\";i:26;s:18:\"﻿个人好好好\";i:27;s:15:\"就人好好好\";i:28;s:15:\"就人好好好\";i:29;s:18:\"﻿个人好好好\";i:30;s:15:\"就人好好好\";i:31;s:18:\"﻿个人好好好\";i:32;s:15:\"就人好好好\";}s:8:\"cur_kytp\";a:1:{i:0;s:56:\"https://www.timg.site/allimg/110729/1_110729095802_4.jpg\";}s:5:\"ky_xt\";a:15:{i:0;s:55:\"https://www.timg.site/allimg/130723/1-130H30R9270-L.jpg\";i:1;s:59:\"https://www.timg.site/allimg/130427/1_130427082450_1-lp.jpg\";i:2;s:56:\"https://www.timg.site/allimg/130301/1-130301093I40-L.jpg\";i:3;s:55:\"https://www.timg.site/alli